import React from "react";

const Pagination = () => {
  return;
  <nav>
    <ul className="pagination">
      <li className="page-item">
        <a></a>
      </li>
    </ul>
  </nav>;
  nav > ul.pagination > li.page - item > a.page - link;
};

export default Pagination;
